import React from 'react';
import { ThumbUpIcon } from '@heroicons/react/outline';
import { AnnotationIcon } from '@heroicons/react/outline';
import { UserIcon } from '@heroicons/react/solid';
import { comment } from 'postcss-selector-parser';

const Post = ({struct}) => {

    const {
        title, description, image, user, createdAT, 
    } = struct;

    return (
    <div className = "bg-white rounded-2xl w-full p-4 my-4">
        <div className = "w-full flex space-around font-bold">
            <h1 className = "w-1/2 ">
            
                {user?.username}
            </h1>
            <h2 className = "w-1/2 text-right">{createdAT}</h2>
        </div>
        <img className = "w-full h-40 object-cover my-2 rounded-2xl" src = {image} alt = "imagen"/>
        <div className = "w-full flex flex-col ">
            <h1 className = "w-1/2 font-bold text-xs">{title}</h1>
            <h2 className = "text-xs">{description}</h2>
        </div>
        <div className = "w-full mt-2">
            <h1 className = "flex text-xs  ">
                <ThumbUpIcon className = "w-4 mr-1"/>
                {/* {likes.lenght} */}
            </h1>
            <h1 className = "flex justify-center items-center text-xs  ">
                {/* {comments.lenght} */}
                <AnnotationIcon className = "w-4 ml-2"/>
            </h1>
        </div>
    </div>
    )
}
export default Post;
